import { Component } from '@angular/core';
import { FormBuilder, FormControl, Validators } from '@angular/forms';
import { Router } from '@angular/router';
import { User } from 'src/app/interface/auth';
import { AuthService } from 'src/app/service/auth.service';

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.scss']
})
export class LoginComponent {


  loginForm = this.fb.group({
    email: new FormControl('', Validators.compose([Validators.required, Validators.email])),
    password: new FormControl('', Validators.compose([Validators.required, Validators.minLength(8)])),
  });

  constructor(
    private fb: FormBuilder,
    private auth: AuthService,
    private router: Router
  ) { }
  get checkValidate() {
    return this.loginForm.controls
  }

  onHandleSubmit(){
    if (this.loginForm.valid) {
      const loginData: User = {
        email: this.loginForm.value.email || '',
        password: this.loginForm.value.password || ''
      };
      this.auth.login(loginData).subscribe(
        (data: any) => {
          localStorage.setItem('token', data.token);
          let token = localStorage.getItem('token');
          if (data.user.role === "admin") {
            this.router.navigate(['/']);

          } else {
            this.router.navigate(['/'])
          }

        },

      );
    }
  }

}

<section class="sigup">
    <div class="container mt-5">
        <div>
            <div class="container w-full  lg:max-w-xl p-6 space-y-8 sm:p-8 bg-white rounded-lg shadow-xl dark:bg-gray-800">
                <h2 class=" text-center text-2xl font-bold text-gray-900 dark:text-white">
                    Đăng Nhập
                </h2>
                <form class="mt-8 space-y-6" action="#" [formGroup]="loginForm" (ngSubmit)="onHandleSubmit()">
                    <div>
                        <label for="email" class="block mb-2 text-sm font-medium text-gray-900 dark:text-white">Email</label>
                        <input type="email" name="email" id="email" 
                        formControlName="email"
                        class="bg-gray-50 border border-gray-300 text-gray-900 text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-full p-2.5 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500" placeholder="name@company.com" required>
                    </div>
                    <div *ngIf="checkValidate['email'].invalid &&checkValidate['email'].dirty ">
                        <div *ngIf="checkValidate['email'].getError('required')">
                            <span class="errormessage">Email không được để trống</span>
                        </div>
                        <div *ngIf="checkValidate['email'].getError('email')">
                            <span class="errormessage">Email không đúng dạng</span>
                        </div>
                    </div>
                    <div>
                        <label for="password" class="block mb-2 text-sm font-medium text-gray-900 dark:text-white">Mật khẩu</label>
                        <input type="password" name="password" id="password" placeholder="••••••••" 

                        class="bg-gray-50 border border-gray-300 text-gray-900 text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-full p-2.5 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500" required>
                    </div>
                    <div class="flex items-start">
                        <div class="flex items-center h-5">
                            <input id="remember" aria-describedby="remember" name="remember" type="checkbox" class="w-4 h-4 border-gray-300 rounded bg-gray-50 focus:ring-3 focus:ring-blue-300 dark:focus:ring-blue-600 dark:ring-offset-gray-800 dark:bg-gray-700 dark:border-gray-600" required>
                        </div>
                        <div class="ml-3 text-sm">
                        <label for="remember" class="font-medium text-gray-500 dark:text-gray-400">Ghi nhớ</label>
                        </div>
                        <a href="#" class="ml-auto text-sm font-medium text-blue-600 hover:underline dark:text-blue-500">Quên mật khẩu</a>
                    </div>
                    <button type="submit" class="w-full px-5 py-3 text-base font-medium text-center text-white bg-blue-700 rounded-lg hover:bg-blue-800 focus:ring-4 focus:ring-blue-300 sm:w-auto dark:bg-blue-600 dark:hover:bg-blue-700 dark:focus:ring-blue-800">Đăng nhập </button>
                    <div class="text-sm font-medium text-gray-900 dark:text-white">
                        Bạn chưa có tài khoản? <a href="#" class="text-blue-600 hover:underline dark:text-blue-500">đăng ký tại đây</a>
                    </div>
                </form>
            </div>
        </div>
    </div>
</section>
